import React from "react";
export default class AddPrizeModal extends React.Component {


  render() {
    if(!this.props.addTicket){
          return null;
      }

    return (
      <React.Fragment>
      <div className="modal">
      <div className="modalmain">
      <p className="ap-text">HEY!</p>
      </div>
      </div>
      </React.Fragment>
    )
  }
}
